create table codePossibilities (
  codePossibilityId     serial primary key,
  firstColor            varchar(10),
  secondColor           varchar(10),
  thirdColor            varchar(10),
  fourthColor           varchar(10),
  possibleMatch         boolean default true
);

create table guesses (
  guessId                 serial primary key,
  firstColor              varchar(10),
  secondColor             varchar(10),
  thirdColor              varchar(10),
  fourthColor             varchar(10),
  correctColorsRightSpot  int,
  correctColorsWrongSpot  int
);

